import re

class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        if len(s) > len(t):
            return False

        result = ''
        s_p = 0
        t_p = 0
        while s_p < len(s) and t_p < len(t):
            if s[s_p] == t[t_p]:
                result += s[s_p]
                s_p += 1
                t_p += 1
            else:
                t_p += 1
        return result == s




if __name__ == '__main__':
    sol = Solution()

    s = "abc"
    t = "ahbgdc"
    assert sol.isSubsequence(s, t) == True


    s = "axc"
    t = "ahbgdc"
    assert sol.isSubsequence(s, t) == False

    s = "leeeeetcode"
    t = ""
    assert sol.isSubsequence(s, t) == True
